import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Schools } from './pages';

function App() {
  return (
    <div>
      <Router>
        <Routes>
          <Route path='/schools' element={<Schools/>}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
